description:
mLogo 3 is a collection of 30 beautiful high quality logotype animations designed to be used within Final Cut Pro X and Motion 5. Just drag your logo, change the colors and you are ready to rock! Simple Effective and ready to use.

Latest version of FCPX and Motion 5 is required.

